import { createStore } from "vuex";

const store = createStore({
  state: {},
  getters: {},
  mutations: {},
  actions: {
    getBlogs() {
      var requestOptions = {
        method: "GET",
        headers: "myHeaders",
        redirect: "follow",
      };

      fetch("https://jsonplaceholder.typicode.com/posts", requestOptions)
        .then((response) => {
          if (response.ok) {
            return response.json();
          }
        })
        .catch((error) => console.log("error", error));
    },
  },
  modules: {},
});

export default store;
